export class home extends Component {

    state = {
        account:null
      };

updateData() {
    console.log('updating data')
    axios.get('http://localhost:3000/Account',{ withCredentials: true  })
    .then(res => {
    if(res) {

      const res_data = res.data;
      this.setState({ account: (res.data) })
      console.log(this.state.account)

    }

    }).catch((error) => {
        console.log(error); //Logs a string: Error: Request failed with status code 404
      //  window.location.href='/auth';

      });
}
componentDidMount() {
    this.updateData();

  }




  render() {
    return (<div>
      home
      <button onClick={e=>this.updateData()}>update data</button>
      <Tabs value={selectedTab} onChange={changeTab}>
  <Tab label="Tab 1" key={0}>
  <div heigh='500px'>
      <AlcoholCalendar updateData={this.updateData.bind(this)}  eating_data={(this.state.account ? this.state.account.activity_data.alcohol_data:{}) }
      />
      </div>  </Tab>
  <Tab label="Tab 2" key={1}>
  <div heigh='500px'>
      <AlcoholCalendar updateData={this.updateData.bind(this)}  eating_data={(this.state.account ? this.state.account.activity_data.alcohol_data:{}) }
      />
      </div>  </Tab>
  <Tab label="Tab 3" key={2}>
    <div>Tab 3 content</div>
  </Tab>
  <Tab label="Tab 4" key={3}>
    <div>Tab 4 content</div>
  </Tab>
</Tabs>

    </div>

    );
  }
}
